const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InnerBlocks,InspectorControls } = wp.blockEditor;

const {
  PanelBody,
  PanelRow,
  RangeControl
} = wp.components;

registerBlockType("gb/gridwithroundimages", {
  title: __("Grid With Round Images", "GB"),
  icon: (
    <img
      alt=""
      src="data:image/jpeg;base64,"
    />
  ),

  category: "team",
  attributes: {
    columns: { type: "number", default: 6 },
    imageUrl: {
      attribute: "src",
      selector: "img",
      default:
        "https://images.unsplash.com/photo-1519244703995-f4e0f30006d5?ixlib=rb-=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=facearea&facepad=8&w=1024&h=1024&q=80",
    },
    contentt: { type: "string", default: `The People` },
    contentUA: {
      type: "string",
      default: `Risus velit condimentum vitae tincidunt tincidunt. Mauris ridiculus fusce amet urna nunc. Ut nisl ornare diam in.`,
    },
    contentUB: { type: "string", default: `Michael Foster` },
    contentUC: { type: "string", default: `Co-Founder / CTO` },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;


    const onChangeColumns = (newColumns) => {
        setAttributes({ columns: newColumns });
    };

    const template = Array.from(Array(attributes.columns).keys()).map((i) => [
      "gb/teammembersmall",
    ]);

    const allowedBlocks = ["gb/teammembersmall"];

    return (
      <div className="bg-white">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>Team members</b>
            </PanelRow>
            <PanelRow>
              <RangeControl
                  label="Columns"
                  value={attributes.columns}
                  onChange={(value) => onChangeColumns(value)}
                  min={1}
                  max={30}
              />
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-w-7xl mx-auto py-12 px-4 text-center sm:px-6 lg:px-8 lg:py-24">
          
          <div className="space-y-8 sm:space-y-12">
            
            <div className="space-y-5 sm:mx-auto sm:max-w-xl sm:space-y-4 lg:max-w-5xl">
              
              <h2 className="text-3xl font-extrabold tracking-tight sm:text-4xl">
                <RichText
                  value={attributes.contentt}
                  default={"The People"}
                  onChange={(newtext) => setAttributes({ contentt: newtext })}
                />
              </h2>
              <p className="text-xl text-gray-500">
                <RichText
                  value={attributes.contentUA}
                  default={
                    "Risus velit condimentum vitae tincidunt tincidunt. Mauris ridiculus fusce amet urna nunc. Ut nisl ornare diam in."
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentUA: newtext })
                  }
                />
              </p>
            </div>
            <ul
              role="list"
              className="mx-auto grid grid-cols-2 gap-x-4 gap-y-8 sm:grid-cols-4 md:gap-x-6 lg:max-w-5xl lg:gap-x-8 lg:gap-y-12 xl:grid-cols-6"
            >
              <InnerBlocks
                    template={template}
                    templateLock="all"
                    allowedBlocks={allowedBlocks}
                />
            </ul>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;

    return (
      <div class="bg-white">
        
        <div class="max-w-7xl mx-auto py-12 px-4 text-center sm:px-6 lg:px-8 lg:py-24">
          
          <div class="space-y-8 sm:space-y-12">
            
            <div class="space-y-5 sm:mx-auto sm:max-w-xl sm:space-y-4 lg:max-w-5xl">
              
              <h2 class="text-3xl font-extrabold tracking-tight sm:text-4xl">
               <RichText.Content value={attributes.contentt}/>
              </h2>
              <p class="text-xl text-gray-500">{attributes.contentUA} </p>
            </div>
            <div
              role="list"
              class="mx-auto grid grid-cols-2 gap-x-4 gap-y-8 sm:grid-cols-4 md:gap-x-6 lg:max-w-5xl lg:gap-x-8 lg:gap-y-12 xl:grid-cols-6"
            >
               <InnerBlocks.Content />
            </div>
          </div>
        </div>
      </div>
    );
  },
});
